import React from 'react'
import {Button, Col} from "reactstrap";

class FeaturesButton extends React.Component{
  render() {
    return(
      <Col xs='12' className='justify-content-center p-0'>
      <Button
        data-aos="fade-up"
        data-aos-duration={this.props.number * 500}
        data-aos-delay="50"
        className='main-page-text features-btn w-100 px-0'
        color="primary"
        onClick={this.props.onClick}
      >
        {this.props.text}
      </Button>
      </Col>
    );
  }
}

export default FeaturesButton;
